+ (void)drawMenuBackgroundWithFrame: (CGRect)frame;
{
    //// General Declarations
    CGColorSpaceRef colorSpace = CGColorSpaceCreateDeviceRGB();
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Color Declarations
    UIColor* chevalLiberte = [UIColor colorWithRed: 0.498 green: 0.134 blue: 0.14 alpha: 1];

    //// Gradient Declarations
    CGFloat gradientLocations[] = {0, 0.9, 1};
    CGGradientRef gradient = CGGradientCreateWithColors(colorSpace, (__bridge CFArrayRef)@[(id)UIColor.whiteColor.CGColor, (id)[UIColor colorWithRed: 0.75 green: 0.75 blue: 0.75 alpha: 1].CGColor, (id)UIColor.grayColor.CGColor], gradientLocations);

    //// Rectangle Drawing
    UIBezierPath* rectanglePath = [UIBezierPath bezierPathWithRect: CGRectMake(0, 0, 320, 568)];
    [VanStyleKit.vermellEquus setFill];
    [rectanglePath fill];


    //// Rectangle 2 Drawing
    CGRect rectangle2Rect = CGRectMake(CGRectGetMinX(frame) + 84, CGRectGetMinY(frame) + 37, 147, 173);
    UIBezierPath* rectangle2Path = [UIBezierPath bezierPathWithRoundedRect: rectangle2Rect byRoundingCorners: UIRectCornerTopLeft | UIRectCornerTopRight | UIRectCornerBottomLeft cornerRadii: CGSizeMake(10, 10)];
    [rectangle2Path closePath];
    CGContextSaveGState(context);
    [rectangle2Path addClip];
    CGContextDrawLinearGradient(context, gradient,
        CGPointMake(CGRectGetMidX(rectangle2Rect), CGRectGetMinY(rectangle2Rect)),
        CGPointMake(CGRectGetMidX(rectangle2Rect), CGRectGetMaxY(rectangle2Rect)),
        0);
    CGContextRestoreGState(context);
    [chevalLiberte setStroke];
    rectangle2Path.lineWidth = 10;
    [rectangle2Path stroke];


    //// Oval Drawing
    CGRect ovalRect = CGRectMake(CGRectGetMinX(frame) + 84, CGRectGetMinY(frame) + 398, 145, 132);
    UIBezierPath* ovalPath = [UIBezierPath bezierPathWithOvalInRect: ovalRect];
    CGContextSaveGState(context);
    [ovalPath addClip];
    CGContextDrawLinearGradient(context, gradient,
        CGPointMake(CGRectGetMidX(ovalRect), CGRectGetMinY(ovalRect)),
        CGPointMake(CGRectGetMidX(ovalRect), CGRectGetMaxY(ovalRect)),
        0);
    CGContextRestoreGState(context);
    [chevalLiberte setStroke];
    ovalPath.lineWidth = 10;
    [ovalPath stroke];


    //// Rectangle 3 Drawing
    CGRect rectangle3Rect = CGRectMake(CGRectGetMinX(frame) + 21, CGRectGetMinY(frame) + 245, 275, 117);
    UIBezierPath* rectangle3Path = [UIBezierPath bezierPathWithRoundedRect: rectangle3Rect byRoundingCorners: UIRectCornerTopLeft | UIRectCornerTopRight | UIRectCornerBottomLeft cornerRadii: CGSizeMake(10, 10)];
    [rectangle3Path closePath];
    CGContextSaveGState(context);
    [rectangle3Path addClip];
    CGContextDrawLinearGradient(context, gradient,
        CGPointMake(CGRectGetMidX(rectangle3Rect), CGRectGetMinY(rectangle3Rect)),
        CGPointMake(CGRectGetMidX(rectangle3Rect), CGRectGetMaxY(rectangle3Rect)),
        0);
    CGContextRestoreGState(context);
    [chevalLiberte setStroke];
    rectangle3Path.lineWidth = 10;
    [rectangle3Path stroke];


    //// Cleanup
    CGGradientRelease(gradient);
    CGColorSpaceRelease(colorSpace);
}

